import React from 'react';
import CompChartDifference from './CompChartDifference';
import CompChartTotal from './CompChartTotal';
import CompChartPassFail from './CompChartPassFail';

const CompChart = ({competitionArray, goal, record, setRecord, time, isComplete, isOwner, isStarted}) => {
  const {duration, units, total, type, startDate} = goal;

  console.log(competitionArray);

  return (
    <div>
      {type === 'difference' &&
        <CompChartDifference 
          duration={duration} 
          units={units} 
          total={total} 
          record={record} 
          time={time}
        />
      }
      {(type === 'total' || type === 'pass/fail') &&
        <CompChartTotal 
          competitionArray={competitionArray}
          units={units} 
          type={type}
        />
      }
    </div>
  )
}

export default CompChart;
